  "inlineSchema": "// This is your Prisma schema file,\n// learn more about it in the docs: https://pris.ly/d/prisma-schema\n\ngenerator client {\n  provider      = \"prisma-client-js\"\n  binaryTargets = [\"native\", \"linux-musl-openssl-3.0.x\"]\n}\n\ndatasource db {\n  provider = \"postgresql\"\n  url      = env(\"DATABASE_URL\") // <-- Não coloque a URL direta aqui!\n}\n\n// ===================================\n// MODELO 1: JOGO (Game)\n// ===================================\nmodel Game {\n  id                 Int      @id @default(autoincrement())\n  title              String   @unique\n  slug               String   @unique\n  //===================================\n  description        String?\n  genre              String[]\n  ageRating          String   @default(\"L\")\n  platforms          String[] @default([\"PC\"])\n  //===================================\n  developer          String[]\n  publisher          String[]\n  releaseDate        DateTime\n  //===================================\n  price              Decimal\n  discountPrice      Decimal?\n  //===================================\n  coverUrl           String?\n  isFeatured         Boolean  @default(false)\n  //===================================\n  systemRequirements Json?\n  //===================================\n  createdAt          DateTime @default(now())\n  updatedAt          DateTime @updatedAt\n\n  // Relacionamentos\n  items       OrderItem[] // Um jogo está em muitos OrderItems (itens de pedido)\n  licenseKeys LicenseKey[] // Um jogo tem muitas LicenseKeys \n  wishlist    Wishlist[] // Um jogo pode estar em muitas wishlists\n  reviews     Review[] // Um jogo pode ter muitas avaliações\n  gallery     GameMedia[] // Um jogo pode ter muitas imagens/videos na galeria\n}\n\n// ===================================\n// MODELO 2: MÍDIAS DO JOGO (GameMedia)\n// ===================================\nmodel GameMedia {\n  id     Int    @id @default(autoincrement())\n  gameId Int\n  type   String // \"IMAGE\" ou \"VIDEO\"\n  url    String // URL da imagem ou Link do YouTube\n\n  // Relacionamento\n  game Game @relation(fields: [gameId], references: [id])\n}\n\n// ===================================\n// MODELO 3: USUÁRIO (User)\n// ===================================\n\nenum Role {\n  USER\n  ADMIN\n}\n\nmodel User {\n  id        Int      @id @default(autoincrement())\n  email     String   @unique\n  name      String\n  nickname  String?  @unique // Apelido, deve ser único\n  avatarUrl String?\n  password  String\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n  role      Role     @default(USER) // Todo usuário é um USER por padrão\n\n  // Relacionamentos\n  orders   Order[] // Um usuário pode ter muitos Orders (pedidos)\n  wishlist Wishlist[] // Um usuário pode adicionar vários jogos à sua wishlist\n  reviews  Review[] // Um usuário pode ter muitas avaliações\n}\n\n// ===================================\n// MODELO 4: PEDIDO/CARRINHO (Order)\n// ===================================\nmodel Order {\n  id        Int      @id @default(autoincrement())\n  userId    Int\n  status    String   @default(\"PENDING\")\n  total     Decimal\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relacionamentos\n  user         User          @relation(fields: [userId], references: [id])\n  items        OrderItem[] // Um pedido tem muitos itens\n  transactions Transaction[] // Um pedido pode ter uma ou mais tentativas de pagamento\n}\n\n// ===================================\n// MODELO 5: ITENS DO PEDIDO (OrderItem)\n// ===================================\nmodel OrderItem {\n  id              Int     @id @default(autoincrement())\n  orderId         Int\n  gameId          Int\n  priceAtPurchase Decimal // Preço que o jogo custava no momento da compra\n  quantity        Int     @default(1)\n\n  // Relacionamentos\n  order       Order        @relation(fields: [orderId], references: [id])\n  game        Game         @relation(fields: [gameId], references: [id])\n  licenseKeys LicenseKey[]\n\n  // Relacionamentos\n  @@unique([orderId, gameId])\n}\n\n// ===================================\n// MODELO 6: TRANSAÇÃO (Transaction)\n// ===================================\nmodel Transaction {\n  id            Int      @id @default(autoincrement())\n  orderId       Int\n  status        String // Ex: SUCCESS, FAILED, PROCESSING\n  amount        Decimal\n  paymentMethod String // Ex: CREDIT_CARD, PIX\n  gatewayId     String? // ID retornado pelo gateway de pagamento\n  createdAt     DateTime @default(now())\n\n  // Relacionamentos\n  order Order @relation(fields: [orderId], references: [id])\n}\n\n// ===================================\n// MODELO 7: MODELO PARA CHAVES DE LICENÇA (LicenseKey)\n// ===================================\nmodel LicenseKey {\n  id        Int     @id @default(autoincrement())\n  keyString String  @unique @db.VarChar(50) // A chave de ativação\n  isUsed    Boolean @default(false) // TRUE se a chave já foi entregue a um cliente\n  gameId    Int // Relacionamento com o Jogo que esta chave pertence\n  game      Game    @relation(fields: [gameId], references: [id])\n\n  // Relacionamentos\n  orderItemId Int?\n  orderItem   OrderItem? @relation(fields: [orderItemId], references: [id])\n\n  createdAt DateTime @default(now())\n}\n\n// ===================================\n// MODELO 8: LISTA DE DESEJOS (Wishlist)\n// ===================================\nmodel Wishlist {\n  id        Int      @id @default(autoincrement())\n  userId    Int\n  gameId    Int\n  createdAt DateTime @default(now())\n\n  // Relacionamentos\n  user User @relation(fields: [userId], references: [id])\n  game Game @relation(fields: [gameId], references: [id])\n\n  @@unique([userId, gameId])\n}\n\n// ===================================\n// MODELO 9: AVALIAÇÃO/REVIEW DOS JOGOS (Review)\n// ===================================\nmodel Review {\n  id        Int      @id @default(autoincrement())\n  rating    Int\n  comment   String?\n  userId    Int\n  gameId    Int\n  createdAt DateTime @default(now())\n\n  // Relacionamentos\n  user User @relation(fields: [userId], references: [id])\n  game Game @relation(fields: [gameId], references: [id])\n}\n",
